import '../Styles/Home.css';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';

function Home() {
  return (
    <div className="Home">
      <header className="Home-header">
        <div className="Home-header-container">
          <p className="Home-header-title">Visualizer</p>
          <p className="Home-header-text">Select an algorithm below to continue!</p>
        </div>
      </header>
      <body className="Home-body">
        <AlgorithmCard title={"Bubble Sort"} body={""} />
        <AlgorithmCard title={"Insertion Sort"} body={""} />
        <AlgorithmCard title={"Selection Sort"} body={""} />
        <AlgorithmCard title={"Merge Sort"} body={""} />
        <AlgorithmCard title={"Quick Sort"} body={""} />
        <AlgorithmCard title={"Quick Select"} body={""} />
        <AlgorithmCard title={"Quick Select"} body={""} />
      </body>
    </div>
  );
}

function AlgorithmCard(props) {
  return (
    <div className="Home-AlgorithmCard">
      <Card sx={{ maxWidth: 345 }}>
        <CardActionArea>
          <CardMedia
            component="img"
            height="140"
            image={require("../Images/contemplative-reptile.jpeg")}
            alt="green iguana"
          />
          <CardContent>
            <Typography gutterBottom variant="h5" component="div">
              {props.title}
            </Typography>
            <Typography variant="body2" color="text.secondary">
              {props.body}
            </Typography>
          </CardContent>
        </CardActionArea>
      </Card>
    </div>
  );
}

export default Home;
